import React from 'react'
import logo from '../dog.svg';

function DoggoList () {
    return (
        <div className="container">
            <div className="doggo-list-box">
                <img src={logo} alt="logo" width="112" height="28" />
                <p>name: shiba inu</p>
                <p>age: 8</p>
                <p>doggo id: J..289k</p>
                <p>description: yes shiba inu breed is the cutest</p>
            </div>
        </div>
    )
}

export default DoggoList
